        const {value} = e.target;
        setinputvalue(value)
        console.log(value);
    }

    return (
        <div className="search">
            <form className="search">
                <input className="inputbox" onChange={handleinputvalue} value={inputvalue} placeholder="Enter anime name" />
                <button className="searchbtn">search</button>  
            </form>
        </div>
    )
}

export default Search
